IF EXISTS (SELECT * FROM dbo.sysobjects WHERE id = OBJECT_ID(N'Taxonomy') 
	AND OBJECTPROPERTY(id, N'IsUserTable') = 1)
DROP TABLE Taxonomy
GO

CREATE TABLE Taxonomy (
	Ident BIGINT IDENTITY(1,1) NOT NULL ,
	Type1 NVARCHAR(MAX) NULL , -- Group/Individual,  Non-individual
	SubType1 NVARCHAR(MAX) NULL , -- Group,  Allopathic & Osteopathic Physicians,  Behavioral Health & Social Service Providers    
	Name1 NVARCHAR(400) NULL , 
	FullName NVARCHAR(MAX) NULL , --Combo of all
	Definition1 NVARCHAR(MAX) NULL , --Blank for now until we can scrape it from the web
	Code1 NVARCHAR(MAX) NULL ,
	AddASUserIdent BIGINT NULL ,
	AddDateTime SMALLDATETIME NULL ,
	EditASUserIdent BIGINT NULL ,	
	EditDateTime SMALLDATETIME NULL ,
	Active BIT NULL
)

CREATE UNIQUE CLUSTERED INDEX idx_Taxonomy_Ident ON Taxonomy(Ident) --NO FILL FACTOR FOR IDENTITY DATA TYPE
GO
CREATE NONCLUSTERED INDEX idx_Taxonomy_Name1 ON Taxonomy(Name1) 
GO

SET IDENTITY_INSERT dbo.Taxonomy ON

INSERT INTO Taxonomy(
	Ident,
	Type1,
	SubType1,
	Name1,
	FullName,
	Definition1,
	Code1,
	AddASUserIdent,
	AddDateTime,
	EditASUserIdent,
	EditDateTime,
	Active
)
