UPDATE Taxonomy
SET 
	Type1 = LTRIM(RTRIM(Type1)),
	SubType1 = LTRIM(RTRIM(SubType1)),
	Name1 = REPLACE(LTRIM(RTRIM(Name1)),'  ', ' '),
	FullName = REPLACE(LTRIM(RTRIM(FullName)),'  ', ' '),
	Definition1 = LTRIM(RTRIM(Definition1)),
	Code1 = LTRIM(RTRIM(Code1))

UPDATE Taxonomy
SET 
	Name1 = LTRIM(RTRIM(LEFT(Name1, LEN(Name1)-3)))
WHERE 
	Name1 like '% >'

